import React, { memo } from 'react';
import { NavLink } from 'react-router-dom';
import './Footer.css'; // Подключаем стили

import Logo from '../Logo/Logo';

const Footer = memo(() => {

  return (
    <section className="footer"> 
      <nav className="footerNav"> 
        <div className="logoBar"> 
          <Logo />
        </div>
        <div className="navLinks"> 
          <NavLink to="/#aboutSection" className="navLink"> 
            О проекте
          </NavLink>

          <NavLink to="/#howItWorksSection" className="navLink"> 
            Как это работает
          </NavLink>

          <NavLink
            to={isLoggedIn ? '/account' : '/welcome'}
            className="navLink"
          >
            Психологам
          </NavLink>

          {!isLoggedIn && (
            <NavLink to="/#faqSection" className="navLink">
              Вопросы
            </NavLink>
          )}

          <NavLink
            to={isLoggedIn ? '/welcome' : '/signin'}
            className="navLink" 
          >
            Личный кабинет психолога
          </NavLink>
        </div>
      </nav>
      <div className="copyRightBlock"> 
        <p className="copyRight">&copy; 2024 Давай поговорим</p> 
      </div>
    </section>
  );
});

export default Footer;
